"\u0412\u043e\u0435\u043d\u043d\u044b\u0439 \u0431\u0438\u043b\u0435\u0442 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u0430 \u042e\u0440\u0438\u044f \u0410\u043d\u0430\u0442\u043e\u043b\u044c\u0435\u0432\u0438\u0447\u0430 (\u0441\u0442\u0440. 23)",
"\u0412\u043e\u0435\u043d\u043d\u044b\u0439 \u0431\u0438\u043b\u0435\u0442 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u0430 \u042e\u0440\u0438\u044f \u0410\u043d\u0430\u0442\u043e\u043b\u044c\u0435\u0432\u0438\u0447\u0430 (\u0441\u0442\u0440. 24)",
