"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u043e\u0439 \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0438\u0438 \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u043d\u044b (\u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0435)",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u043e\u0439 \u041a\u0441\u0435\u043d\u0438\u0438 \u0410\u043d\u0430\u0442\u043b\u044c\u0435\u0432\u043d\u044b (\u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0435)",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0414\u043e\u043c\u0440\u0430\u0447\u0435\u0432\u043e\u0439 \u041a\u0441\u0435\u043d\u0438\u0438 \u0422\u0438\u043c\u043e\u0444\u0435\u0435\u0432\u043d\u044b",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u041f\u043e\u043f\u043e\u0432\u043e\u0439 \u041c\u0430\u0440\u0438\u0438 \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u043d\u044b",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0428\u0435\u0441\u0442\u0430\u043a\u043e\u0432\u0430 \u0422\u0438\u043c\u043e\u0444\u0435\u044f \u041b\u0435\u043e\u043d\u0442\u044c\u0435\u0432\u0438\u0447\u0430 (\u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0435)",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0428\u0435\u0441\u0442\u0430\u043a\u043e\u0432\u043e\u0439 \u0410\u043d\u043d\u044b \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u043d\u044b (\u043f\u043e\u0432\u0442\u043e\u0440\u043d\u043e\u0435)",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0430 \u0418\u0432\u0430\u043d\u0430 \u0424\u0435\u0434\u043e\u0440\u043e\u0432\u0438\u0447\u0430",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e\u0431 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0438 7-\u043b\u0435\u0442\u043d\u0435\u0439 \u0448\u043a\u043e\u043b\u044b \u0410\u043d\u0438\u043a\u0435\u0435\u0432\u0430 \u0413\u0435\u043d\u043d\u0430\u0434\u0438\u044f \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\u0430",
"\u0421\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e\u0431 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0438 7-\u043b\u0435\u0442\u043d\u0435\u0439 \u0448\u043a\u043e\u043b\u044b \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0430 \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u044f \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\u0430",
"\u0421\u0435\u043b\u0438\u0432\u0430\u043d\u043e\u0432 \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447",
"\u0421\u0435\u043b\u0438\u0432\u0430\u043d\u043e\u0432\u0430 \u042e\u043b\u0438\u044f \u0412\u0430\u043b\u0435\u0440\u044c\u0435\u0432\u043d\u0430",
"\u0421\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u043e \u0410\u043d\u0438\u043a\u0435\u0435\u0432\u044b\u0445 \u0432\u043e \u0434\u0432\u043e\u0440\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0434\u043e\u043c\u0430",
"\u0421\u043f\u0440\u0430\u0432\u043a\u0430 \u0410\u043d\u0438\u043a\u0435\u0435\u0432\u043e\u0439 \u0410\u043d\u043d\u044b \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u044b, \u0447\u0442\u043e \u043e\u043d\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0436\u0435\u043d\u043e\u0439 \u0443\u043c\u0435\u0440\u0448\u0435\u0433\u043e \u0438\u043d\u0432\u0430\u043b\u0438\u0434\u0430 \u0412\u041e\u0412",
"\u0421\u043f\u0440\u0430\u0432\u043a\u0430 \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0428\u0435\u0441\u0442\u0430\u043a\u043e\u0432\u0430 \u041b\u0435\u043e\u043d\u0442\u0438\u044f \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\u0430",
"\u0421\u043f\u0440\u0430\u0432\u043a\u0430 \u043e \u0441\u043c\u0435\u0440\u0442\u0438 \u0428\u0435\u0441\u0442\u0430\u043a\u043e\u0432\u043e\u0439 \u041c\u0430\u0442\u0440\u043e\u043d\u044b \u0413\u0430\u0432\u0440\u0438\u043b\u043e\u0432\u043d\u044b",
